import "./works.scss";
import {
    featuredPortfolio,
    webPortfolio,
    mobilePortfolio,
    designPortfolio,
    contentPortfolio
} from "../../data.js";

export default function Works() {

    return (
        <div className='works' id="works">
            <div className="container">
                {featuredPortfolio.map((d) => (
                    <div className="itemContainer">
                        <div className="item">
                            <div className="left">
                                <p>{d.title}</p>
                            </div>
                            <div className="right">
                                <img src={d.img} />
                            </div>
                        </div>
                    </div>

                ))}</div>
            <img className="arrow left" src="../assets/outline_keyboard_arrow_down_black_24dp.png" />

            <img className="arrow right" src="../assets/outline_keyboard_arrow_down_black_24dp.png" />

        </div>
    )
}
